div.div:
#include <iostream>
int main(int argc, char** argv) {
std::cout << "Hello, World!" << std::endl;
return 0;
}
Перед cout и endl написаны сочетание std и оператор ::.
Первое указывает на так называемое пространство имен (namespace), в данном случае на стандартное пространство имен std, в котором находятся все классы, функции, переменные и другие объекты стандартной библиотеки.
Второе же является оператором разрешения области видимости (scope resolution operator), который позволяет опуститься в скоуп пространства имен или класса (структуры).
